The best way to see if the situation has changed is by using the latest version of TF.
@gunan has the situation described in #9778 changed?
We also don't support most third-party use cases by default (e.g. Onnx), but it looks to me like Onnx would be best run on a Linux platform, not Windows. You could try using Docker or Vagrant for this, but the specifics would be a question for Stack Overflow.

